def _validate_pcoa_score(feature_key, final_value, payload) -> bool:
    """
    规则：PCoA 第一主成分得分,通常为实数(可正可负)。
    - 接受字符串数字或数值类型
    - 理论上无严格上下限,但设定合理范围 -100 到 100 以过滤明显异常值
    - 不接受 None、空字符串或非数值类型
    
    适用于:
    - Back_PCoA1_WeightedUniFrac: 基于加权UniFrac距离的PCoA第一轴
    - Back_PCoA1_UnweightedUniFrac: 基于无权重UniFrac距离的PCoA第一轴
    - Back_PCoA1_Jaccard: 基于Jaccard距离的PCoA第一轴
    - Back_PCoA1_BrayCurtis: 基于Bray-Curtis距离的PCoA第一轴
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        score = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # PCoA 得分通常在 -100 到 100 之间,超出此范围可能是数据异常
    # 根据实际数据分布可以调整此范围
    return -100 <= score <= 100


def _validate_feature_count(feature_key, final_value, payload) -> bool:
    """
    规则：特征计数,表示检测到的特征总数(如物种、基因家族、功能通路等)。
    - 接受字符串数字或数值类型
    - 必须为非负整数
    - 理论上限设为 100000,超过此值可能是数据异常
    - 不接受 None、空字符串、负数或非整数类型
    
    适用于:
    - Back_FeatureCount: 宏基因组样本中检测到的所有特征总数
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        count = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # 检查是否为整数(允许浮点表示的整数,如 5.0)
    if count != int(count):
        return False
    
    count = int(count)
    
    # 特征计数必须为非负整数,上限设为 100000
    # 根据实际测序深度和分析管线可调整此上限
    return 0 <= count <= 100000

def _validate_faith_pd(feature_key, final_value, payload) -> bool:
    """
    规则：Faith's Phylogenetic Diversity (PD),基于系统发育树的多样性指标。
    - 接受字符串数字或数值类型
    - 必须为非负实数(系统发育树分支长度总和不可能为负)
    - 理论上限设为 1000,超过此值可能是数据异常
    - 不接受 None、空字符串或非数值类型
    
    适用于:
    - Back_faith_pd: 后背样本的Faith系统发育多样性指数
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        pd_value = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # Faith's PD 必须为非负实数,上限设为 1000
    # 根据实际系统发育树规模和测序深度可调整此上限
    return 0 <= pd_value <= 1000


def _validate_observed_otus(feature_key, final_value, payload) -> bool:
    """
    规则：观测到的OTU数量,α多样性指标之一。
    - 接受字符串数字或数值类型
    - 必须为非负整数
    - 理论上限设为 50000,超过此值可能是数据异常
    - 不接受 None、空字符串、负数或非整数类型
    
    适用于:
    - Back_observed_otus: 后背样本中观测到的OTU总数
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        count = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # 检查是否为整数(允许浮点表示的整数,如 5.0)
    if count != int(count):
        return False
    
    count = int(count)
    
    # 观测OTU数必须为非负整数,上限设为 50000
    # 根据实际测序深度和聚类算法可调整此上限
    return 0 <= count <= 50000


def _validate_shannon_index(feature_key, final_value, payload) -> bool:
    """
    规则：Shannon多样性指数,综合评估物种丰富度和均匀度。
    - 接受字符串数字或数值类型
    - 必须为非负实数(理论上Shannon指数≥0)
    - 理论上限设为 15,超过此值可能是数据异常
    - 不接受 None、空字符串或非数值类型
    
    适用于:
    - Back_shannon: 后背样本的Shannon多样性指数
    
    注：典型的微生物群落Shannon指数通常在0-10之间,
    设定15为上限以容纳极端高多样性情况
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        shannon = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # Shannon指数必须为非负实数,上限设为 15
    # 根据实际微生物群落复杂度可调整此上限
    return 0 <= shannon <= 15

def _validate_genus_abundance(feature_key, final_value, payload) -> bool:
    """
    - 接受字符串数字或数值类型
    - 必须为非负实数
    - 理论上范围通常为 0-1 
    - 不接受 None、空字符串或非数值类型
    
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        abundance = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # 我看表格基本都是（0，1），如果有问题再换成100上限
    return 0 <= abundance <= 1

def _validate_species_abundance(feature_key, final_value, payload) -> bool:
    """
    规则：物种水平相对丰度 (Species Relative Abundance)。
    - 接受字符串数字或数值类型
    - 必须为非负实数
    - 理论上范围通常为 0-100 (百分比) 或 0-1 (比例)
    - 设定上限为 100 以兼容百分比表示
    - 不接受 None、空字符串或非数值类型
    
    适用于:
    - 宏基因组 Species 级别的相对丰度特征
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        abundance = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # 相对丰度必须为非负,上限设为 100 (兼容百分比)
    return 0 <= abundance <= 100

def _validate_cytokine_pg_ml(feature_key, final_value, payload) -> bool:
    """
    规则：炎症因子浓度 (pg/mL)。
    - 接受字符串数字或数值类型
    - 必须为非负实数
    - 设定上限为 100,000 pg/mL 以涵盖极端炎症状态但过滤错误数据
    - 不接受 None、空字符串或非数值类型
    
    适用于:
    - IFN-γ, IL-10 等细胞因子
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        concentration = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # 浓度必须为非负, 上限设为 100,000 pg/mL (100 ng/mL)
    return 0 <= concentration <= 100000


def _validate_metabolic_hormone_pg_ml(feature_key, final_value, payload) -> bool:
    """
    规则：代谢激素/多肽浓度 (pg/mL)。
    - 接受字符串数字或数值类型
    - 必须为非负实数
    - 设定上限为 1,000,000 pg/mL (1000 ng/mL) 以涵盖高浓度激素(如极高Leptin)
    - 不接受 None、空字符串或非数值类型
    
    适用于:
    - C-peptide, Leptin, GIP 等代谢指标
    - 注：Leptin在肥胖人群中可达 100 ng/mL (100,000 pg/mL) 以上
    """
    if final_value is None or final_value == "":
        return False
    
    try:
        concentration = float(final_value)
    except (TypeError, ValueError):
        return False
    
    # 浓度必须为非负, 上限设为 1,000,000 pg/mL
    return 0 <= concentration <= 1000000